              sunt in culpa qui officia deserunt mollit anim id est laborum."
            </p>
    );
    const footer =(
      <div className="read__more">
              <a className="read__link" href="#card">
                Leer m√°s...
              </a>
              <p className="like">
                37 <i className="fas fa-heart" />
              </p>
            </div>
    );
